import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import "../sass/style.scss";
import { Link } from "react-router-dom";
import Copyright from "../images/copyrights.svg";

const Footer = () => (
  <>
    <div id="wrap">
      <div id="main" className="App clear-top footer">
        {/* full footer row */}
        <Row className="footer-margin">
          {/* column for copyrights */}
          <Col lg={4}>
            {/* row for copyrights */}

            <img className="img-fluid col-centered" src={Copyright} />
            <p>2020 Hira Fareed</p>
          </Col>

          {/* end of copyrights column */}

          {/* row for email */}

          <Col lg={4}>
            <p>hirafareedkapadia@gmail.com</p>
          </Col>

          {/* end of row for email */}

          <Col lg={4}>
            {/* row for contact links */}

            <p>Behance/</p>

            <p>LinkedIn/</p>

            <p>Dribble</p>
          </Col>

          {/* end of row for contact links */}
        </Row>
      </div>
    </div>
    <footer class="footer"></footer>
  </>
);

export default Footer;
